Without question my favorite day on a bicycle… there was a moment when I wished it could have gone on forever. When building a route I often want the experience to hit a crescendo towards the end. Day 7 in the Westfjords was that day. I knew it was going to be a massive day of challenging terrain with over 10,000 ft of climbing & 100+ miles on tap for our tired bodies and loaded bikes. But this day was unlike the others in that every curve of the road brought you to a new engaging feature, it was impossible not to stop every few moments and take it in. We scored perfect weather.. that kind I have only seen a handful of times here and milked every last second of light. This was yesterday and it still feels a bit like a dream.

Thanks a million @evanruderman for capturing it so well. Thanks to @laelwilcox @nicholekbaker @paysonmcelveen @rugilekaladyte for being the best riding partners anyone could ask for.

