Hard to put into a simple caption these last 500 miles. The thousands of revolutions you make on a bicycle moving through this landscape are utterly meaningless if not for the amazing people you meet, the food you enjoy and the glimpses of pure magic you get to take in along the way. I do these trips as an opportunity to slow down my life in order to savor it a little longer. Often these projects take a year of planning or more and are over in the blink of an eye. Sad to only have 120 miles or so more over the next two days with these amazing humans I get to now call friends. And to the people of the Westfjords, your hospitality knows no bounds and I know many cyclists who follow will be grateful for the warm meal & a good story.

