There are some days when the weather just laughs as you. That was today. Windy, cold, muddy and completely joyous after today’s 135 mile ride straight into an Icelandic headwind with loaded bikes. It was so strong that more than once it pushed us off the road. Those moments make you reevaluate life for a second hahah. 
All in All it was a good day filled with a lot of laughter and big muddy smiles. Sadly some of that mud on @laelwilcox was definitely from sheep poop 😅
Our bikepacking route through the WestFjords is coming together. Can’t wait for others to come and explore it.

